import { ListItem } from "@mui/material";

function VideoClips (props)
{
    return(
        <ul>
           {props.videoClips.map(clip =>{
               return (
                   <li key = {clip.name}>{clip.name}</li>
               );
           })}
        </ul>
    );
}

export default VideoClips;
